import React from 'react';
export const Header = () => {
  return (
    <div className="jumbotron jumbotronheight">
      <div className="row">
        <div className="col-12 text-center">
          <h6 className="text-uppercase">Welcome!</h6>
        </div>
      </div>
    </div>
  );
};
